import React from "react";

import StyleView from "./StyleView/index";

//import axios from "axios";

const BuyStyle = ( props ) =>{

    const { flagShow, cartImg, productList, user, itemid} = props

    return(
        <>
        {
            flagShow ? <StyleView 
            user={user} 
            cartImg={cartImg} productList={Object.keys(productList).map((key)=>productList[key])}/> :''
        }
        </>
      )
}

export default BuyStyle
